function getAllTeams(){var e=document.getElementById("eventCode").value;document.getElementById("viewTeamsButton").innerHTML="Requesting Data...";let t=new XMLHttpRequest;t.open("GET",`/api/events/current/${e}/teams`,!0),t.withCredentials=!0,t.onreadystatechange=async()=>{if(t.readyState===XMLHttpRequest.DONE&&200===t.status)return window.allTeams=t.responseText.split(","),console.log(getDifference()),document.getElementById("eventLabel").style.display="none",document.getElementById("eventCode").insertAdjacentHTML("afterend",`<div id="unscouted"><br><span>To Scout: </span><br>${getDifference().join("<br>")}</div>`),document.getElementById("eventCode").style.display="none",document.getElementById("viewTeamsButton").innerHTML="Done!",0;401===t.status||403===t.status?window.location.href="/login":400===t.status?document.getElementById("viewTeamsButton").innerHTML="bad request":500===t.status?document.getElementById("viewTeamsButton").innerHTML="internal server error":document.getElementById("viewTeamsButton").innerHTML="downloading data..."},t.send()}function getScoutedTeams(){var e=document.getElementById("eventCode").value;document.getElementById("viewTeamsButton").innerHTML="Requesting Data...";let t=new XMLHttpRequest;t.open("GET",`/api/teams/current/${e}/pitscoutedteams`,!0),t.withCredentials=!0,t.onreadystatechange=async()=>{if(t.readyState===XMLHttpRequest.DONE&&200===t.status)return window.scoutedTeams=t.responseText.split(","),getAllTeams(),0;401===t.status||403==t.status?window.location.href="/login":400===t.status?document.getElementById("viewTeamsButton").innerHTML="bad request":500===t.status?document.getElementById("viewTeamsButton").innerHTML="internal server error":document.getElementById("viewTeamsButton").innerHTML="downloading data..."},t.send()}function getDifference(){return window.allTeams.filter(e=>!window.scoutedTeams.includes(e))}function getUnscoutedTeams(){getScoutedTeams()}window.allTeams=[],window.scoutedTeams=[];